import { FunctionComponent } from "react";
import Navbar from "../components/navbar";
import ProductTemplate from "../components/ProductTemplate";

// Define the type for the selectedProduct prop
type Product = {
  id: number;
  name: string;
  imageSrc: string;
  store: String;
  price: number;
  description: String
};

type Desktop3Props = {
  SelectedProduct: Product; // Replace 'Product' with your actual product type
};

const Desktop3: FunctionComponent<Desktop3Props> = ({ SelectedProduct }) => {
  return (
    <div className="relative bg-white w-full h-[1024px] overflow-hidden text-left text-3xl text-darkslategray-100 font-sora">
      <div className="absolute top-[144px] left-[126px] w-[1202px] h-[863px]">
        {/* Pass the selected product to ProductTemplate */}
        <ProductTemplate product={SelectedProduct} />
      </div>
      <Navbar />
    </div>
  );
};

export default Desktop3;
